import React from "react";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import { useEffect, useContext } from "react";
import { AppContext } from "../App";

function Navmenu() {
  const { loginStatus, user } = useContext(AppContext);
  return (
    <>
      <nav className="p-5 bg-white shadow">
        <div>
          <span className></span>
          <img
            className="h-10 inline"
            src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.socializeagency.com%2F&psig=AOvVaw3TL6J1b06PHgc5hZFaJtXe&ust=1666536995794000&source=images&cd=vfe&ved=0CA0QjRxqFwoTCLjzs6KM9PoCFQAAAAAdAAAAABAl"
          ></img>
        </div>
      </nav>
    </>
  );
}

export default Navmenu;
